import React from 'react'
import { Redirect, Route } from 'react-router-dom';
import Admin from './pages/Admin';
import User from './pages/User';


const PrivateRoute = ({ component: Comp, loggedIn, path }) => {
    return (
        <Route
            path={path}
            render={() => {
                return loggedIn ? (
                    loggedIn.role === "ROLE_USER" && Comp === "User" ? <User/> : (
                        loggedIn.role === "ROLE_ADMIN" && Comp === "Admin" && <Admin />
                    )
                ) : (
                        <Redirect
                            to={{
                                pathname: "/"
                            }}
                        />
                    );
            }}
        />
    );
};

export default PrivateRoute
